import React from "react";
import "./Setting_up.css";
import deski_ash from "../assets/deski_ash.svg";
import { Pane } from "evergreen-ui";

function Setting_up() {
    return (
        <div>
            <div className="login">
                <img src={deski_ash} alt="" className="login_logo" height="80" width="120" />
            </div>
            <div className="login">
                <Pane className="login_pane" elevaton={3}>
                    <h1>hai</h1>
                </Pane>
            </div>
        </div>
    );
}

export default Setting_up;
